const number = 2 // количество карточек в блоке

const timeout = 3 * 1000; // в мс

const min = 50;
const max = 4000;
const prefix = ' RUB';
////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////

var app = new Vue({
	delimiters: ['{[', ']}'],
	template: '<div id="container"><div id = "card" v-for="(card, num) in cards" :key="num"><div><img :src="card.src"></div><div id="description"><div id="wrap-prize"><span>{[winSum()]}</span></div><div id="wrap-username"><span>{[card.username]}</span></div><div id="wrap-play-button"><a id="play-button" :href="card.link">ИГРАТЬ</a></div></div></div></div>',
	el: '#app',
	data () {
		return {
			cards: [],
			base: 'https://100casino.azurewebsites.net'
		}
	},
	created () {
		this.generateNewCards()
		setInterval(this.generateNewCards, timeout);
	},
	methods: {
		generateNewCards () {
			var temp = [] // временные для накопления карточек массив
			// подготавливаем индексы картинок
			var indexesImg = new Set() // картинки в выборке не будут повторяться, поэтому используем множество
			// в цикле собираем нужно количество уникальных индексов
			indexesImg.add(Math.floor(Math.random()*resources.images.length))
			while (indexesImg.size <= number)
			{
				indexesImg.add(Math.floor(Math.random()*resources.images.length))
			}
			// приводим в массив
			indexesImg = Array.from(indexesImg)
			// подготавливаем индексы имен
			var indexesName = new Set() // имена в выборке не будут повторяться, поэтому используем множество
			// в цикле собираем нужно количество уникальных индексов
			while (indexesName.size <= number) indexesName.add(Math.floor(Math.random()*resources.names.length))
			// приводим в массив
			indexesName = Array.from(indexesName)
			for (var i = 0; i < number; i++) {
				const card = {
					src: this.base + resources.images[indexesImg[i]].src,
					link: this.base + resources.images[indexesImg[i]].link,
					username: resources.names[indexesName[i]]
				}
				temp.push(card)
			}
			this.cards = temp;
		},
		winSum () {
			return  Math.floor ( ( Math.random() * ( max - min ) ) + min ) + prefix;
		}
	}
})

